DROP TABLE IF EXISTS `users_charge_record`;

CREATE TABLE `users_charge_record` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '账户ID',
  `charge_id` varchar(20) NOT NULL DEFAULT '' COMMENT '充值订单号',
  `order_id` varchar(50) NOT NULL DEFAULT '' COMMENT '关联的内部订单号',
  `transaction_no` varchar(64) NOT NULL DEFAULT '' COMMENT '第三方交易号ID',
  `third_pay_user` varchar(50) NOT NULL DEFAULT '' COMMENT '第三方支付账号',
  `pay_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '支付方式 1：支付宝 2：微信 3: 苹果内购',
  `pay_channel_type` varchar(32) NOT NULL DEFAULT '' COMMENT '用户所选渠道类型',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '充值金额',
  `count` int(11) NOT NULL DEFAULT '0' COMMENT '钻石数量',
  `buy_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '充值时间',
  `status` tinyint(2) DEFAULT '0' COMMENT '0 未完成 1 完成 3 支付完成/未加钱',
  `status_detail` varchar(30) NOT NULL DEFAULT '' COMMENT '记录错误码',
  `charge_type` tinyint(3) NOT NULL DEFAULT '1' COMMENT '1 直接充值 2 消费充值',
  `charge_from` varchar(32) NOT NULL DEFAULT '' COMMENT '充值来源',
  `user_token` varchar(200) NOT NULL DEFAULT '' COMMENT '用户提交订单时所用的 token',
  `app_from` varchar(20) NOT NULL DEFAULT '',
  `created` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`,`created`),
  KEY `idx_charge_id` (`charge_id`),
  KEY `idx_user_id_charge_type_buy_time` (`user_id`,`charge_type`,`buy_time`),
  KEY `idx_btime_status_count` (`buy_time`,`status`,`count`),
  KEY `idx_created_status` (`created`,`status`),
  KEY `idx_status_ptype` (`status`,`pay_type`),
  KEY `tra_no` (`transaction_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户充值记录';

